  display: flex;
  justify-content: flex-start;
  flex-direction: column;
  width: 250px;
  margin-bottom: -20px;
  margin-left: 30px;
  color: #fff;
`;

const Item = styled.div`
  margin-left: 1vw;
  height: 480px;
  width: 320px;
  border: solid #d72323 5px;
  border-radius: 1.2rem;
  display: flex;
  flex-direction: column;
`;

